import Header from '../components/header';
import '../css/site.css'

const Layout = props => (
  <div className='layoutStyle'>
      <style global jsx>{`
    body {
      background-image: url("../images/bg.jpg");
    }
  `}</style>
    <Header />
    {props.children}
  </div>
);

export default Layout;
